    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service collaborated
    with the U.S. Geological Survey to conduct a national survey of visitors regarding
    their experiences on National Wildlife Refuges. The purpose of the survey was to
    better understand visitor experiences and trip characteristics, to gauge visitorsu2019
    levels of satisfaction with existing recreational opportunities, and to garner feedback
    to inform the design of programs and facilities. The survey results will inform
    performance, planning, budget, and communications goals. Results will also inform
    Comprehensive Conservation Plans (CCPs), visitor services, and transportation planning
    processes. This Data Series consists of 25 separate data files.",nt"owner_org":
